#### Definitions

**1** Â  (1) In this Act:

**"adverse claim"** means a claim that

(a) the claimant has a property interest in a financial asset, and

(b) it is a violation of the rights of the claimant for another person to hold, transfer or deal with the financial asset;

**"appropriate person"** means,

(a) with respect to an endorsement, the person specified by a security certificate or by an effective special endorsement to be entitled to the security,

(b) with respect to an instruction, the registered owner of an uncertificated security,

(c) with respect to an entitlement order, the entitlement holder,

(d) in the case of a person referred to in paragraph (a), (b) or (c) being deceased, that person's successor taking under the law, other than this Act, or that person's personal representative acting for the estate of the deceased person, and

(e) in the case of a person referred to in paragraph (a), (b) or (c) lacking capacity, that person's guardian or other similar representative who has power under the law, other than this Act, to transfer the security or other financial asset;

**"bearer form"** means, in respect of a certificated security, a form in which the security is payable to the bearer of the security certificate according to the security certificate's terms but not by reason of an endorsement;

**"broker"** has the same meaning as "dealer" in the [*Securities Act*](https://www.bclaws.gov.bc.ca/civix/document/id/complete/statreg/00_96418_01);

**"certificated security"** means a security that is represented by a certificate;

**"clearing agency"** means a person

(a) who carries on a business or activity as a clearing agency or clearing house within the meaning of the [*Securities Act*](https://www.bclaws.gov.bc.ca/civix/document/id/complete/statreg/00_96418_01) or the securities regulatory law of another province or territory in Canada,

(b) who is recognized or otherwise regulated as a clearing agency or clearing house by the British Columbia Securities Commission or by a securities regulatory authority of another province or territory in Canada, and

(c) who is a securities and derivatives clearing house for the purposes of section 13.1 of the [*Payment Clearing and Settlement Act*](https://www.bclaws.gov.bc.cahttp://laws-lois.justice.gc.ca/eng/acts/P-4.4/index.html) (Canada) or whose clearing and settlement system is designated under Part I of that Act;

**"communicate"** means

(a) send a signed writing, or

(b) transmit information by any other means agreed to by the person transmitting the information and the person receiving the information;

**"control"** has the meaning set out in sections 23 to 26;

**"corporation"** means any body corporate whether or not it is incorporated under the laws of British Columbia;

**"delivery"**, with respect to a certificated or uncertificated security, has the meaning set out in section 68;

**"effective"**, in relation to an endorsement, instruction or entitlement order, has the meaning set out in sections 29 to 32;

**"endorsement"** means a signature that, alone or accompanied by other words, is made on a security certificate in registered form or on a separate document for the purpose of assigning, transferring or redeeming the security or granting a power to assign, transfer or redeem the security;

**"entitlement holder"** means a person identified in the records of a securities intermediary as the person having a security entitlement against the securities intermediary and includes a person who acquires a security entitlement by virtue of section 95 (1) (b) or (c);

**"entitlement order"** means a notice communicated to a securities intermediary directing the transfer or redemption of a financial asset to which the entitlement holder has a security entitlement;

**"financial asset"** means, except as otherwise provided in sections 10 to 16,

(a) a security,

(b) an obligation of a person that

(i)  is, or is of a type, dealt in or traded on financial markets, or

(ii)  is recognized in any other market or area in which it is issued or dealt in as a medium for investment,

(c) a share, participation or other interest in a person, or in property or an enterprise of a person, that,

(i)  is, or is of a type, dealt in or traded on financial markets, or

(ii)  is recognized in any other market or area in which it is issued or dealt in as a medium for investment,

(d) any property that is held by a securities intermediary for another person in a securities account if the securities intermediary has expressly agreed with the other person that the property is to be treated as a financial asset under this Act, or

(e) a credit balance in a securities account, unless the securities intermediary has expressly agreed with the person for whom the account is maintained that the credit balance is not to be treated as a financial asset under this Act;

**"genuine"** means free of forgery or counterfeiting;

**"government"** means

(a) the Crown in right of Canada or in right of British Columbia or another province of Canada,

(b) the government of a territory in Canada,

(c) a municipality in Canada, or

(d) the government of a foreign country or of any political subdivision of it;

**"in collusion"** means in concert, by conspiratorial arrangement or by agreement for the purpose of violating a person's rights in respect of a financial asset;

**"instruction"** means a notice communicated to the issuer of an uncertificated security that directs that the transfer of the security be registered or that the security be redeemed;

**"issuer"**,

(a) with respect to a registration of a transfer of a security, means a person on whose behalf transfer books are maintained, and

(b) with respect to an obligation on or a defence to a security, includes

(i)  a person who places or authorizes the placing of the person's name on a security certificate, other than as authenticating trustee, registrar, transfer agent or the like, to evidence

(A) a share, participation or other interest in the person's property or in an enterprise, or

(B) the person's duty to perform an obligation represented by the security certificate,

(ii)  a person who creates a share, participation or other interest in the person's property or in an enterprise, or undertakes an obligation, that is an uncertificated security,

(iii)  a person who directly or indirectly creates a fractional interest in the person's rights or property, if the fractional interest is represented by a security certificate,

(iv)  a guarantor, to the extent of the guarantor's guarantee, whether or not the guarantor's obligation is noted on a security certificate, and

(v)  a person who becomes responsible for, or in place of, another person described as an issuer in this definition;

**"knowledge"** means actual knowledge;

**"overissue"** means the issue of securities in excess of the amount that the issuer is authorized to issue;

**"person"** means

(a) an individual, including an individual in his or her capacity as trustee, executor, administrator or other representative,

(b) a sole proprietorship,

(c) a partnership,

(d) an unincorporated association,

(e) an unincorporated syndicate,

(f) an unincorporated organization,

(g) a trust, including a business trust,

(h) a corporation,

(i) a government or agency of it, or

(j) any other legal or commercial entity;

**"protected purchaser"** means a purchaser of a certificated or uncertificated security, or of an interest in the security, who

(a) gives value,

(b) does not have notice of any adverse claim to the security, and

(c) obtains control of the security;

**"purchase"** means a taking by sale, discount, negotiation, mortgage, hypothec, pledge, security interest, issue or reissue, gift or any other voluntary transaction that creates an interest in property;

**"purchaser"** means a person who takes by purchase;

**"registered form"** means, in respect of a certificated security, a form in which

(a) the security certificate specifies a person entitled to the security, and

(b) a transfer of the security may be registered on books maintained for that purpose by or on behalf of the issuer, or the security certificate states that it may be so registered;

**"representative"** means any person empowered to act for another, including an agent, an officer of a corporation or association and a trustee, executor or administrator of an estate;

**"secured party"** has the same meaning as in the [*Personal Property Security Act*](https://www.bclaws.gov.bc.ca/civix/document/id/complete/statreg/96359_01);

**"securities account"** means an account to which a financial asset is or may be credited in accordance with an agreement under which the person maintaining the account undertakes to treat the person for whom the account is maintained as entitled to exercise the rights that constitute the financial asset;

**"securities intermediary"** means,

(a) a clearing agency, or

(b) a person, including a broker, bank or trust company, who, in the ordinary course of the person's business, maintains securities accounts for others and is acting in that capacity;

**"security"** means, except as otherwise provided in sections 10 to 16, an obligation of an issuer or a share, participation or other interest in an issuer or in property or an enterprise of an issuer

(a) that is represented by a security certificate in bearer form or registered form, or the transfer of which may be registered on books maintained for that purpose by or on behalf of the issuer,

(b) that is one of a class or series, or by its terms is divisible into a class or series, of shares, participations, interests or obligations, and

(c) that

(i)  is, or is of a type, dealt in or traded on securities exchanges or securities markets, or

(ii)  is a medium for investment and by its terms expressly provides that it is a security for the purposes of this Act;

**"security certificate"** means a certificate representing a security, but does not include a certificate in electronic form;

**"security entitlement"** means the rights and property interest of an entitlement holder with respect to a financial asset that are specified in Part 6;

**"security interest"** has the same meaning as in the [*Personal Property Security Act*](https://www.bclaws.gov.bc.ca/civix/document/id/complete/statreg/96359_01);

**"unauthorized"** means, when used with reference to a signature or endorsement, a signature or endorsement that is made without actual, implied or apparent authority or that is forged;

**"uncertificated security"** means a security that is not represented by a certificate;

**"value"** means any consideration sufficient to support a simple contract and includes an antecedent debt or liability.

(2) As the context requires, **"financial asset"** means either the interest itself or the means by which a person's claim to it is evidenced, including a certificated or uncertificated security, a security certificate and a security entitlement.

(3) The characterization of a person, business or transaction for the purposes of this Act does not determine the characterization of the person, business or transaction for the purposes of any other statute, law, regulation or rule.

#### Law governing validity of security

**44** Â  (1) The validity of a security is governed by the following laws:

(a) if the issuer is incorporated under a law of Canada, the law, other than the conflict of law rules, of Canada;

(b) if the issuer is the Crown in right of Canada, the law, other than the conflict of law rules, of Canada;

(c) if the issuer is the Crown in right of a province in Canada, the law, other than the conflict of law rules, of the province;

(d) if the issuer is the Commissioner of a territory in Canada, the law, other than the conflict of law rules, of the territory;

(e) in any other case, the law, other than the conflict of law rules, of the jurisdiction under which the issuer is incorporated or otherwise organized.

(2) The law, other than the conflict of law rules, of the issuer's jurisdiction governs

(a) the rights and duties of the issuer with respect to the registration of transfer,

(b) the effectiveness of the registration of transfer by the issuer,

(c) whether the issuer owes any duties to an adverse claimant to a security, and

(d) whether an adverse claim can be asserted against a person

(i)  to whom the transfer of a certificated or uncertificated security is registered, or

(ii)  who obtains control of an uncertificated security.

(3) The following issuers may specify the law of another jurisdiction as the law governing the matters referred to in subsection (2) (a) to (d):

(a) an issuer incorporated or otherwise organized under the law of British Columbia;

(b) the government of British Columbia.

(4) Whether a security is enforceable against an issuer despite a defence or defect described in sections 57 to 59 is governed by the following laws:

(a) if the issuer is incorporated under a law of Canada, the law, other than the conflict of law rules, of the province or territory in Canada in which the issuer has its registered office or head office;

(b) if the issuer is the Crown in right of Canada, the law, other than the conflict of law rules, of the issuer's jurisdiction;

(c) if the issuer is the Crown in right of a province in Canada, the law, other than the conflict of law rules, of the province;

(d) if the issuer is the Commissioner of a territory in Canada, the law, other than the conflict of law rules, of the territory;

(e) in any other case, the law, other than the conflict of law rules, of the jurisdiction under which the issuer is incorporated or otherwise organized.

(5) In this section, **"issuer's jurisdiction"** means the jurisdiction determined in accordance with the following rules:

(a) if the issuer is incorporated under a law of Canada, the province or territory in Canada in which the issuer has its registered office or head office or, if permitted by the law of Canada, another jurisdiction specified by the issuer;

(b) if the issuer is the Crown in right of Canada, the jurisdiction specified by the issuer;

(c) if the issuer is the Crown in right of a province in Canada, the province or, if permitted by the law of that province, another jurisdiction specified by the issuer;

(d) if the issuer is the Commissioner of a territory in Canada, the territory or, if permitted by the law of that territory, another jurisdiction specified by the issuer;

(e) in any other case, the jurisdiction under which the issuer is incorporated or otherwise organized or, if permitted by the law of that jurisdiction, another jurisdiction specified by the issuer.

#### Matters governed by law of securities intermediary's jurisdiction

**45** Â  (1) The law, other than the conflict of law rules, of the securities intermediary's jurisdiction governs

(a) acquisition of a security entitlement from the securities intermediary,

(b) the rights and duties of the securities intermediary and entitlement holder arising out of a security entitlement,

(c) whether the securities intermediary owes any duty to a person who has an adverse claim to a security entitlement, and

(d) whether an adverse claim may be asserted against a person who

(i)  acquires a security entitlement from the securities intermediary, or

(ii)  purchases a security entitlement, or interest in it, from an entitlement holder.

(2) In this section, **"securities intermediary's jurisdiction"** means the jurisdiction determined in accordance with the following rules:

(a) if an agreement between a securities intermediary and the securities intermediary's entitlement holder governing the securities account expressly provides that a particular jurisdiction is the securities intermediary's jurisdiction for the purposes of the law of that jurisdiction, this Act or any provision of this Act, the jurisdiction expressly provided for is the securities intermediary's jurisdiction;

(b) if paragraph (a) does not apply and an agreement between the securities intermediary and the securities intermediary's entitlement holder governing the securities account expressly provides that the agreement is governed by the law of a particular jurisdiction, that jurisdiction is the securities intermediary's jurisdiction;

(c) if neither paragraph (a) nor (b) applies and an agreement between a securities intermediary and the securities intermediary's entitlement holder governing the securities account expressly provides that the securities account is maintained at an office in a particular jurisdiction, that jurisdiction is the securities intermediary's jurisdiction;

(d) if none of the preceding paragraphs applies, the securities intermediary's jurisdiction is the jurisdiction in which the office identified in an account statement as the office serving the entitlement holder's account is located;

(e) if none of the preceding paragraphs applies, the securities intermediary's jurisdiction is the jurisdiction in which the chief executive office of the securities intermediary is located.

(3) In determining a securities intermediary's jurisdiction, the following matters are not to be taken into account:

(a) the physical location of certificates representing financial assets;

(b) if an entitlement holder has a security entitlement with respect to a financial asset, the jurisdiction in which the issuer of the financial asset is incorporated or otherwise organized;

(c) the location of facilities for data processing or other record keeping concerning the securities account.

#### Notice of seizure to secured party

**51** Â  The interest of a judgment debtor in any of the following may be seized by a sheriff serving a notice of seizure on the secured party:

(a) a certificated security for which the security certificate is in the possession of a secured party;

(b) an uncertificated security registered in the name of a secured party;

(c) a security entitlement maintained in the name of a secured party.

#### Assurances respecting endorsement or instruction

**87** Â  (1) An issuer may require the following assurance that each necessary endorsement or each instruction is genuine and authorized:

(a) in all cases, a guarantee of the signature of the person making the endorsement or originating the instruction, including, in the case of an instruction, reasonable assurance of identity;

(b) if the endorsement is made or the instruction is originated by an agent, appropriate assurance of actual authority to act;

(c) if the endorsement is made or the instruction is originated by a fiduciary or successor referred to in paragraph (d) or (e) of the definition of "appropriate person" in section 1 (1), appropriate evidence of appointment or incumbency;

(d) if there is more than one fiduciary or successor referred to in paragraph (d) or (e) of the definition of "appropriate person" in section 1 (1), reasonable assurance that all who are required to sign have done so;

(e) if the endorsement is made or the instruction is originated by a person not referred to in paragraph (b), (c) or (d) of this subsection, assurance appropriate to the case corresponding as nearly as may be to the assurance required by paragraph (b), (c) or (d).

(2) An issuer may elect to require reasonable assurance beyond that specified in this section.

(3) In this section:

**"appropriate evidence of appointment or incumbency"** means,

(a) in the case of a fiduciary appointed or qualified by a court, a document issued by or under the direction or supervision of the court or an officer of the court and dated within 60 days before the date of presentation for transfer, and

(b) in any other case,

(i)  a copy of a document showing the appointment,

(ii)  a certificate certifying the appointment issued by or on behalf of a person reasonably believed by the issuer to be a responsible person, or

(iii)  in the absence of a document or certificate referred to in subparagraph (i) or (ii), other evidence that the issuer reasonably considers appropriate;

**"fiduciary"** means any person acting in a fiduciary capacity, and includes a personal representative acting for the estate of a deceased person;

**"guarantee"** means a guarantee signed by or on behalf of a person reasonably believed by the issuer to be a responsible person.

(4) For the purposes of the definition of "guarantee" in subsection (3), an issuer may adopt any standards with respect to responsibility so long as those standards are not manifestly unreasonable.
